import React from 'react';

function App() {
  const offices = [
    { Name: 'DBS', Rent: 50000, Address: 'Chennai', Image: 'data:image/jpeg;base64,' },
    { Name: 'TCS Space', Rent: 70000, Address: 'Bangalore', Image: 'data:image/jpeg;base64,' },
    { Name: 'WeWork', Rent: 60000, Address: 'Hyderabad', Image: 'data:image/jpeg;base64,' }
  ];

  return (
    <div>
      <h1>Office Space, at Affordable Range</h1>

      {offices.map((office, index) => {
        const rentStyle = {
          color: office.Rent <= 60000 ? 'red' : 'green'
        };

        return (
          <div key={index} style={{ marginBottom: '30px', borderBottom: '1px solid #ccc' }}>
            <img src={office.Image} alt="Office Space" width="250" height="150" />
            <h2>Name: {office.Name}</h2>
            <h3 style={rentStyle}>Rent: Rs. {office.Rent}</h3>
            <h3>Address: {office.Address}</h3>
          </div>
        );
      })}
    </div>
  );
}

export default App;
